    [],nt"num_tags": 5,nt"name": "seney-national-wildlife-refuge-annual-narrative-report-calendar-year-1976",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Seney
    National Wildlife Refuge outlines Refuge accomplishments during the 1976 calendar
    year. The report begins with an introduction to the Refuge and information about
    climatic and habitat conditions and the system status. Construction, maintenance,
    and wildfires are also described. Habitat management is covered; croplands, wetlands,
    forestlands, and wilderness and special areas are discussed. The wildlife section
    of the report discusses endangered and threatened species, migratory birds, mammals,
    and non-migratory birds. Interpretation and recreation activities are outlined;
    topics include information and interpretation, recreation, and law enforcement.
    Field investigations, cooperative programs, items of interest, and safety information
    are discussed. Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
